                    bridle) sits here when riding. Horses also use their lips to explore and play.</desc>

                <desc id="desc12558">The loin is the area between the last rib and the croup. It acts like a bridge,
                    helping connect the horse’s front and back ends. A strong loin helps a horse carry a rider easily.
                </desc>

                <desc id="desc12550">The sheath is a fold of skin that covers and protects the male horse’s reproductive
                    organ. It helps keep the area clean and safe from injury. Proper care of the sheath is important for
                    the horse’s health, and sometimes it needs gentle cleaning by an experienced person or a
                    veterinarian.</desc>
